import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./Components/Login";
import { useState, useEffect } from "react";
import { getUsers } from "./Services/UsersService";
import { getAdmins } from "./Services/AdminsService";
import Header from "./Components/Header";
import Footer from "./Components/Footer";

function App() {
  const [type, setType] = useState(0);
  const [users, setUsers] = useState([]);
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    getUsers().then((res) => {
      setUsers(res.data);
    });

    getAdmins().then((res) => {
      setAdmins(res.data);
    });
  }, []);

  const checkLogin = (guest) => {
    users.forEach((element) => {
      if (element.username === guest.user) {
        if (element.password === guest.pass) setType(1);
        else alert("Username or password incorrect");
      }
    });
  };

  if (type === 0) {
    return <Login checkLogin={checkLogin} />;
  }

  if (type === 1) {
    console.log("OKKK");
  }

  return (
    <div>
      <Router>
        <div className="container">
          <Routes>
            {type === 1 ? (
              <Route path="/home/admin" element={<Header />} />
            ) : (
              <Route path="/home/user" element={<Footer />} />
            )}
          </Routes>
          <Login />
        </div>
      </Router>
    </div>
  );
}

export default App;
